{
  "type": "object",
  "title": "IMember",
  "description": "Member information schema",
  "required": ["id", "name", "email", "age", "hobbies", "created_at", "updated_at"],
  "properties": {
    "id": {
      "type": "string",
      "format": "uuid",
      "description": "Unique identifier of the member"
    },
    "name": {
      "type": "string",
      "description": "Name of the member"
    },
    "email": {
      "type": "string",
      "format": "email",
      "description": "Email address of the member"
    },
    "age": {
      "type": "number",
      "minimum": 20,
      "exclusiveMaximum": 100,
      "description": "Age of the member (20 <= age < 100)"
    },
    "hobbies": {
      "type": "array",
      "description": "List of hobbies of the member",
      "items": {
        "type": "object",
        "required": ["id", "name"],
        "properties": {
          "id": {
            "type": "string",
            "format": "uuid",
            "description": "Unique identifier of the hobby"
          },
          "name": {
            "type": "string",
            "description": "Name of the hobby"
          }
        }
      }
    },
    "created_at": {
      "type": "string",
      "format": "date-time",
      "description": "Created date and time"
    },
    "updated_at": {
      "type": "string",
      "format": "date-time",
      "description": "Last updated date and time"
    },
    "deleted_at": {
      "oneOf": [
        {
          "type": "null"
        },
        {
          "type": "string",
          "format": "date-time"
        }
      ],
      "description": "Deleted date and time or null when not deleted"
    }
  }
}

